PROCEDURE SPINSERTADATOS IS
  BEGIN

DELETE FROM SCSISGES.TAFXCAMPANASMKT;
DELETE FROM SCSISGES.TCCAMPANAMKT;
DELETE FROM SCSISGES.TACAMPANACTE;
-- COMMIT;
-- INSERTS DE CAMPAÑAS    

END SPINSERTADATOS;

PROCEDURE SPEXECUTEMKT IS
numRegistros SMALLINT;
PA_PAIS NUMBER:=1;
PA_NEGOCIO NUMBER:=1;
PA_TAMANIOBULK NUMBER:=100000;
PA_FINALIZOWK NUMBER;
PA_FINALIZOSP  NUMBER;
PA_CODERROR NUMBER;
PA_DESCERROR VARCHAR2(200);
vl_bandera NUMBER:=0;
VL_CTESCAMP NUMBER;
VL_CTESCARGADOS NUMBER;
  BEGIN
    --REGISTRAMOS INICIO DE WF
     vl_bandera := SCSISGES.fncontrolprocesos(
    EXTRACT (YEAR FROM SYSDATE),
                                    EXTRACT (MONTH FROM SYSDATE),
                                    EXTRACT (DAY FROM SYSDATE),
                                 TO_CHAR (SYSDATE, 'HH:MI:SS'), /*hora de inicio del proceso*/
                                TO_CHAR (SYSDATE, 'HH:MI:SS'),/*hora fin del proceso*/
                               'WF_FENIXCAMPMKT',
                               SYSDATE, /*FECHA DE EJECUCION*/
                               NULL,/*DESCRIPCION DEL ERROR*/
                               0,/*STATUS, INDICAR INICIO DE MAPA*/
                               0,/*ID DEL PROCESO*/
                               2 /*indicamos el inicio de un mapa*/);
                               
   
 
  --REGISTRAR FINALIZACION DE WF
  vl_bandera := SCSISGES.fncontrolprocesos(
  EXTRACT (YEAR FROM SYSDATE),
  EXTRACT (MONTH FROM SYSDATE),
  EXTRACT (DAY FROM SYSDATE),
  TO_CHAR (SYSDATE, 'HH:MI:SS'), /*hora de inicio del proceso*/
  TO_CHAR (SYSDATE, 'HH:MI:SS'),/*hora fin del proceso*/
   'WF_FENIXCAMPMKT',
   SYSDATE, /*FECHA DE EJECUCION*/
   NULL,/*DESCRIPCION DEL ERROR*/
   1,/*STATUS, INDICAR FINAL DE MAPA*/
   1,/*ID DEL PROCESO*/
   2 /*indicamos el inicio de un mapa*/);
   
   SCSISGES.PACAMPANASMKT.SPPROCESAMKT(
         PA_PAIS,
         PA_NEGOCIO,
         PA_TAMANIOBULK,
         PA_FINALIZOWK,
         PA_FINALIZOSP,
         PA_CODERROR,
         PA_DESCERROR
   );
    ut.expect(PA_FINALIZOSP,'Finalizo el proceso correctamente').to_(equal(1));
    SELECT COUNT (1) INTO VL_CTESCAMP FROM SCSISGES.TAFXCAMPANASMKT CTE JOIN SCSISGES.TCCAMPANAMKT CAMP ON CTE.FIIDCAMPANA = CAMP.FIIDCAMPANA; 
    SELECT COUNT (1) INTO VL_CTESCARGADOS FROM SCSISGES.TACAMPANACTE;
    ut.expect(VL_CTESCARGADOS,'SE CARGO EL TOTAL DE CLIENTES EN CAMPAÑAS DE CONSUMO').to_(equal(VL_CTESCAMP));
    
END SPEXECUTEMKT;

end test_pacampanasmkt;

